import React from 'react';
<script src="https://kit.fontawesome.com/525a7ba6e9.js" crossorigin="anonymous"></script>
const FooterAluno = () => {
    return (
        <footer className='text-center' style={{  
            position : 'static',
            left: 0,
            bottom: 0,
            width: '100%'
        }}>
           <i class="fab fa-facebook"></i> 
            <h3> Projeto EDUX </h3>
            <small> Desenvolvido pela dupla de 2 </small>
        </footer>
    )
}

export default FooterAluno;
